import { TiDelete } from "react-icons/ti";
import { TiTick } from "react-icons/ti";

function Todo({ todo, removeTodo, markDone }) {
  return (
    <div className={todo.done ? "todo" : "todo_done"}>
      <p>{todo.name}</p>
      <div className="todo_icons">
        <TiTick className="todo_tick" onClick={markDone}/>
        <TiDelete className="todo_remove" onClick={removeTodo}/>
      </div>
    </div>
   );
}

export default Todo;
